import { useState } from 'react'
import NFLPlayers from './components/NFLPlayers'

const App = () => {
  const [nflPlayers] = useState([
    {
      player: "Joe Banyard",
      team: "JAX",
      pos: "RB",
      att: 2
    },
    {
      id: 2,
      player :"Shaun Hill",
      team : "MIN",
      pos : "QB",
      att : 5
    }
  ])

  return (
    <div className='container'>
      {nflPlayers.length > 0 ? (
        <NFLPlayers nflPlayers={nflPlayers} />
      ) : ( 'No NFL Players' )}
    </div>
  )
}

export default App
